                "change #payScheduleOne"   : "scheduleOneSelected",
                "change #payScheduleRecur" : "recurringSelected",
                "keyup #remarks" : "checkRemarksLimit",

                "click #cancel" : "showPendingTransfers",
                "submit #editFundsTransferForm" : "submitEditFundsTransfer"
